
DROP TABLE IF EXISTS `vendor`;
CREATE TABLE `vendor` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `platform`;
CREATE TABLE `platform` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `platformversion`;
CREATE TABLE `platformversion` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,`platform` int unsigned NOT NULL,PRIMARY KEY (`id`),FOREIGN KEY(platform) REFERENCES platform(id));

DROP TABLE IF EXISTS `device`;
CREATE TABLE `device` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,`vendor` int unsigned NOT NULL,`platformversion` int unsigned NOT NULL,PRIMARY KEY (`id`),FOREIGN KEY(vendor) REFERENCES vendor(id),FOREIGN KEY(platformversion) REFERENCES platformversion(id));


DROP TABLE IF EXISTS `cap`;
CREATE TABLE `cap` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,`platform` int unsigned NOT NULL,PRIMARY KEY (`id`),FOREIGN KEY(platform) REFERENCES platform(id));

DROP TABLE IF EXISTS `capvalue`;
CREATE TABLE `capvalue` (`id` int unsigned NOT NULL,`value` varchar(200) NOT NULL,PRIMARY KEY (`id`));


DROP TABLE IF EXISTS `mosynccap`;
CREATE TABLE `mosynccap` (`id` int unsigned NOT NULL,`name` varchar(50) NOT NULL,PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `mosynccapcap`;
CREATE TABLE `mosynccapcap` (`id` int unsigned NOT NULL,`mosynccap` int unsigned NOT NULL,`cap` int unsigned NOT NULL,PRIMARY KEY (`id`),FOREIGN KEY(mosynccap) REFERENCES mosynccap(id),FOREIGN KEY(cap) REFERENCES cap(id));

DROP TABLE IF EXISTS `devicecapvalue`;
CREATE TABLE `devicecapvalue` (`id` int unsigned NOT NULL,`device` int unsigned NOT NULL,`cap` int unsigned NOT NULL,`capvalue` int unsigned NOT NULL,PRIMARY KEY (`id`),FOREIGN KEY(device) REFERENCES device(id),FOREIGN KEY(cap) REFERENCES cap(id),FOREIGN KEY(capvalue) REFERENCES capvalue(id));
